import React, { useState,useEffect} from 'react';

// import { Container } from './styles';

export default function Demo(props) {
    const[Feilds,setFeilds]=useState([])
    const [Data,setData]=useState([])
    useEffect(() => {
        const data=props.data;
        setData()
        const modified=data.map((val,ind)=>(val));
         const itemValues= Object.values(modified)
         setFeilds(itemValues)
         console.log(Feilds)
    }, [Feilds])
    

  return (
    <div className="d-flex flex-wrap h-100 justify-content-center align-items-center w-100">
   {data.map((val,ind)=>(
           <div className="Card shadow w-25 p-3 rounded">
           <div className="d-flex flex-column align-items-start">
   {Object.keys(val).map((item,key)=>(  <div className="mb-2"><span className="label">{item}</span>{" : "} <span>{Feilds[key]}</span></div>))}
             
               </div>
       </div>
   ))}
  


    </div>
  );
}
